-- ----------------------------
-- Table structure for `bbssku`
-- ----------------------------
DROP TABLE IF EXISTS `bbssku`;
CREATE TABLE `bbssku` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `productid` int(11) NOT NULL COMMENT '商品ID',
  `colorid` int(11) DEFAULT NULL COMMENT '颜色ID',
  `size` varchar(5) DEFAULT NULL COMMENT '尺码',
  `delivefee` double DEFAULT NULL COMMENT '运费 默认10元',
  `skuprice` double(20,2) NOT NULL COMMENT '售价',
  `stockinventory` int(5) NOT NULL COMMENT '库存',
  `skuupperlimit` int(5) DEFAULT NULL COMMENT '购买限制',
  `location` varchar(80) DEFAULT NULL COMMENT '仓库位置:货架号',
  `skuimg` varchar(80) DEFAULT NULL COMMENT 'SKU图片  精确到颜色及尺码对应的图片',
  `skusort` int(5) DEFAULT NULL COMMENT '前台显示排序',
  `skuname` varchar(500) DEFAULT NULL COMMENT 'SKU名称',
  `marketprice` double(20,2) DEFAULT NULL COMMENT '市场价',
  `createtime` datetime DEFAULT NULL,
  `updatetime` datetime DEFAULT NULL,
  `createuserid` varchar(255) DEFAULT NULL,
  `updateuserid` varchar(255) DEFAULT NULL,
  `laststatus` tinyint(4) DEFAULT NULL COMMENT '0,历史 1最新',
  `skutype` tinyint(4)  DEFAULT NULL COMMENT '0:赠品,1普通',
  `sales` int(10) DEFAULT NULL COMMENT '销量',
  PRIMARY KEY (`id`),
  KEY `productid` (`productid`),
  KEY `colorid` (`colorid`),
  CONSTRAINT `bbsskuibfk1` FOREIGN KEY (`productid`) REFERENCES `bbsproduct` (`id`),
  CONSTRAINT `bbsskuibfk2` FOREIGN KEY (`colorid`) REFERENCES `bbscolor` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=516 DEFAULT CHARSET=utf8 COMMENT='最小销售单元';

